package slidingwindow

import (
	"reflect"
	"testing"

	"github.com/stretchr/testify/assert"
)

func Test_findMinimumWindoeSubstring(t *testing.T) {
	type args struct {
		s string
		t string
	}
	tests := []struct {
		name string
		args args
		want string
	}{
		{
			name: " minimum substring",
			args: args{s: "ADOBECODEBANC", t: "ABC"},
			want: "BANC",
		},
		{
			name: " minimum substring",
			args: args{
				s: "",
				t: "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ",
			},
			want: "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ",
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got := findMinimumWindoeSubstring(tt.args.s, tt.args.t)

			assert.Equal(t, tt.want, got)
		})
	}
}

func TestStringPermutationCheck(t *testing.T) {
	type args struct {
		input   string
		pattern string
	}
	tests := []struct {
		name string
		args args
		want bool
	}{
		{
			name: " minimum substring",
			args: args{input: "ADOBECODEBANC", pattern: "ABC"},
			want: false,
		},

		{
			name: " minimum substring",
			args: args{input: "ADOBACODEBANC", pattern: "ABC"},
			want: true,
		},

		{
			name: " minimum substring",
			args: args{input: "bcdxabcdy", pattern: "bcdyabcdx"},
			want: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got := StringPermutationCheck(tt.args.input, tt.args.pattern)
			assert.Equal(t, tt.want, got)
		})
	}
}

func TestStringAnagrams(t *testing.T) {
	type args struct {
		input   string
		pattern string
	}
	tests := []struct {
		name string
		args args
		want []int
	}{
		{
			name: " minimum substring",
			args: args{input: "abbcabc", pattern: "abc"},
			want: []int{2, 3, 4},
		},

		{
			name: " minimum substring",
			args: args{input: "addbda", pattern: "abc"},
			want: []int{},
		},
		{
			name: " minimum substring",
			args: args{input: "abcabcabc", pattern: "abc"},
			want: []int{0, 1, 2, 3, 4, 5, 6},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := StringAnagrams(tt.args.input, tt.args.pattern); !reflect.DeepEqual(got, tt.want) {
				t.Errorf("StringAnagrams() = %v, want %v", got, tt.want)
			}
		})
	}
}
